const reducer = (state = '', action,magad='') => {
    switch (action.type) {
        case "deposit":
            return state + action.payload;

        case "withdraw":
            return state - action.payload;

        case "success":
            alert('successfully logged in..... ');

        case "magaze":
            console.log('inside magaze', action.payload)
            magad = action.payload;
            console.log('------', state);
            return magad;

        default:
            return state
    }
};

export default reducer;
